import React from 'react';
import "../src/css/bgmi.css";
import ProgressBar from 'react-bootstrap/ProgressBar';
function Bgmi() {
  return (
    <div className='bmain'>
        <div className='bsolo'>
            <div id='bimage'></div>
            <div id='bdown'>
                <h4>TYPE : <span>SOLO</span></h4>
                <h4>MAP : <span>ERANGLE</span></h4>
                <h4>DATE : <span>1/1/2004</span></h4>
                <h4>TIME : <span>11:00 am</span></h4>
            </div>
            <ProgressBar now={60} color='blue'/>
        </div>
    </div>
  )
}

export default Bgmi
